I am so stoked to announce the release of ShadowRealm’s public ProAM Car Pack! The team at @shadowrealm have been working hard and we are excited to finally share this major project with you guys. Head over to @vosanco and download the pack! For more information regarding the pack see below.

The shadowrealm ProAM Car Pack has been developed to provide realism through distinctive handling physics; while also designed to bridge the gap between street cars and pro cars. Our Pro AM pack contains 13 cars ranging from American muscle to JDM rippers with likes of a SN95 to a FD RX-7. All car specs: 550-650 whp, 65° to 70° degrees of steering angle, and 255/30/18 rear tires. The best place to download the pack is through our link at discord.gg/shadowrealm.

