I had so much fun at the 5/21 open drift at @evergreenspeedway — drift fam is the best thanks again to my coach @_matthewseven (in the vid)😊 can’t wait to go back. Unfortunately, I have to go to the Philippines for a funeral, but I’ll be back in July! I’m beyond excited for the @flagsnwheels angle kit and @fealsuspension (thx Steve and Steven!) to go in the car. Next time I’ll be trying out a 225/235 front and 265 rear setup. I really want some 18s but haven’t decided between @esrwheels @kanseiwheels or @cosmisracingusa or even @enkeiwheels RPF1s. Would love to hear y’all’s opinion in the comments. Since this car is pretty low horsepower, I’m aiming for a maximum seat time build which means running the most cost efficient tires possible.

So far I’ve changed spark plugs (2 were falling out, most were hand right), wires, cap and rotor, serpentine belt tensioner, belt, and done fluids and filters. I will also be doing carbon clutch packs so hopefully the diff stops unlocking. Open to advice as well!

